const quiz5 = data.map((v, i) => {
  v.fullName = v.fullName.split(" ")[0];
  v.creditCard = `${v.creditCard.slice(0, 4)}${v.creditCard
    .slice(4)
    .split("")
    .map((v) => "*")
    .join()}`;
  v.money = `${parseInt(v.money.replace("$", "")) * 1393.1}원(KRW)`;

  return v;
});

console.log("quiz5:", quiz5);
